import React from "react";
import imageMeals from "../../assets/meals.jpg"
import classes from "./Header.module.css";

const Header = (props) => {
  return (
    <React.Fragment>
      <header className={classes.header}>
        <h1>React Meals</h1>
        <button type="">Cart</button>
      </header>
      <div className={classes['main-image']} a>
        <img src={imageMeals}/>
      </div>
    </React.Fragment>
  );
};

export default Header;
